import React from 'react';
import { motion } from 'framer-motion';
import { FaFileAlt, FaSearch, FaUniversity, FaCheckCircle, FaPassport, FaUserGraduate } from 'react-icons/fa';
import useTheme from '../../hooks/useTheme';

const AdmissionProcess = () => {
  const theme = useTheme();
  
  const steps = [
    {
      id: 1,
      title: 'Documents Submission',
      description: 'Submit your academic and personal documents to info@stepseeducation.co.uk',
      icon: <FaFileAlt className="text-3xl text-indigo-600" />,
      emoji: '📄'
    },
    {
      id: 2,
      title: 'Assessment',
      description: 'Our team will assess your documents within 3 days',
      icon: <FaSearch className="text-3xl text-indigo-600" />,
      emoji: '🔍'
    },
    {
      id: 3,
      title: 'Course & University Selection',
      description: 'We\'ll recommend the best courses and universities based on your profile',
      icon: <FaUniversity className="text-3xl text-indigo-600" />,
      emoji: '🏛️'
    },
    {
      id: 4,
      title: 'Offer Letter',
      description: 'Receive your offer letter within 2 weeks of application',
      icon: <FaCheckCircle className="text-3xl text-indigo-600" />,
      emoji: '📝'
    },
    {
      id: 5,
      title: 'CAS/Approval',
      description: 'Get your Confirmation of Acceptance for Studies (CAS) for visa application',
      icon: <FaPassport className="text-3xl text-indigo-600" />,
      emoji: '🛂'
    },
    {
      id: 6,
      title: 'Enrollment',
      description: 'Complete enrollment process with full support from our team',
      icon: <FaUserGraduate className="text-3xl text-indigo-600" />,
      emoji: '🎓'
    },
  ];

  // Animation variants
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: { 
      opacity: 1,
      transition: { 
        staggerChildren: 0.2,
        delayChildren: 0.1
      }
    }
  };
  
  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0, transition: { duration: 0.6 } }
  };

  return (
    <section className="py-24 bg-gradient-to-b from-white to-indigo-50 relative overflow-hidden">
      <div className="absolute inset-0 pattern-dots opacity-5"></div>
      
      <div className="container mx-auto px-4 relative z-10">
        <motion.div
          variants={itemVariants}
          className="text-center mb-16"
        >
          <span className="inline-block px-3 py-1.5 bg-indigo-100 text-indigo-700 rounded-full text-sm font-medium mb-4">
            6-Step Process
          </span>
          <h2 className="text-3xl md:text-4xl font-bold text-gradient mb-4">Admission Process</h2>
          <div className="w-20 h-1.5 bg-gradient-to-r from-indigo-600 to-blue-500 rounded-full mx-auto mb-6"></div>
          <p className="text-gray-600 max-w-3xl mx-auto text-lg">
            Our streamlined 6-step admission process is designed to make your educational journey smooth and stress-free.
            From document submission to enrollment, we provide comprehensive support at every stage.
          </p>
        </motion.div>

        <motion.div 
          className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-10"
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
        >
          {steps.map((step) => (
            <motion.div
              key={step.id}
              variants={itemVariants}
              whileHover={{ y: -8, transition: { duration: 0.3 } }}
              className="bg-white p-8 rounded-2xl shadow-xl hover:shadow-2xl border border-gray-100 hover:border-indigo-100 transition-all duration-300"
            >
              <div className="relative mb-6">
                <div className="w-16 h-16 rounded-xl bg-indigo-100 flex items-center justify-center">
                  <span className="text-3xl">{step.emoji}</span>
                </div>
                <div className="absolute -top-2 -left-2 bg-gradient-to-r from-indigo-600 to-blue-500 text-white rounded-full w-8 h-8 flex items-center justify-center font-bold text-sm shadow-lg">
                  {step.id}
                </div>
              </div>
              
              <h3 className="text-xl font-bold text-indigo-700 mb-3">{step.title}</h3>
              <p className="text-gray-600">{step.description}</p>
            </motion.div>
          ))}
        </motion.div>

        <motion.div
          variants={itemVariants}
          className="mt-16 text-center"
        >
          <div className="bg-white/80 backdrop-blur-sm p-8 rounded-2xl shadow-xl border border-gray-100 max-w-2xl mx-auto">
            <p className="text-lg text-indigo-700 font-medium mb-6">
              Need assistance with the admission process? Contact us for detailed guidance.
            </p>
            <a
              href="mailto:info@stepseeducation.co.uk"
              className="inline-block px-8 py-4 bg-gradient-to-r from-indigo-600 to-blue-500 text-white font-semibold rounded-full hover:shadow-lg shadow-xl shadow-indigo-900/20 transition-all duration-300 transform hover:-translate-y-1"
            >
              Email: info@stepseeducation.co.uk
            </a>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default AdmissionProcess;
